import React from "react";
import Posts from "./Posts.css";

function PostItem(props) {
  return (
    <div>
      <h1>{props.title}</h1>
      <h3>{props.date}</h3>
      <p>{props.content}</p>
    </div>
  );
}

export default PostItem;
